import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Chatbot from './Pages/Chatbot/Chatbot';

function App() {
  return (
    <BrowserRouter>
      <Router>
        <Routes>
          <Route path="/chatbot" element={<Chatbot />} />
        </Routes>
      </Router>
    </BrowserRouter>
  );
}

export default App;
